import React, { useState, useEffect, useContext } from 'react';
import AuthContext from '../context/AuthContext';
import * as userService from '../services/user';
import LoadingSpinner from '../components/common/LoadingSpinner';
import './Profile.css';

const Profile = () => {
  const { user, loading: authLoading } = useContext(AuthContext);
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    age: '',
    state: '',
    gender: '',
  });
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (user && user.profile) {
      setFormData({
        firstName: user.profile.firstName || '',
        lastName: user.profile.lastName || '',
        age: user.profile.age || '',
        state: user.profile.state || '',
        gender: user.profile.gender || '',
      });
    }
  }, [user]);

  const { firstName, lastName, age, state, gender } = formData;

  const onChange = (e) =>
    setFormData({ ...formData, [e.target.name]: e.target.value });

  const onSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setMessage('');
    setError('');
    try {
      await userService.updateMyProfile(formData);
      setMessage('Profile updated successfully!');
      // Note: You may need to re-fetch the user in AuthContext to show updated navbar info
    } catch (err) {
      setError(err.toString());
    } finally {
      setLoading(false);
    }
  };

  if (authLoading || !user) return <LoadingSpinner />;

  return (
    <div className="profile-container">
      <h2>My Profile</h2>
      <p>Update your personal information. This is used for eligibility checks.</p>
      
      {message && <div className="profile-message success">{message}</div>}
      {error && <div className="profile-message error">{error}</div>}

      <form className="profile-form" onSubmit={onSubmit}>
        <div className="form-group">
          <label htmlFor="firstName">First Name</label>
          <input type="text" name="firstName" value={firstName} onChange={onChange} />
        </div>
        <div className="form-group">
          <label htmlFor="lastName">Last Name</label>
          <input type="text" name="lastName" value={lastName} onChange={onChange} />
        </div>
        <div className="form-group">
          <label htmlFor="age">Age</label>
          <input type="number" name="age" value={age} onChange={onChange} />
        </div>
        <div className="form-group">
          <label htmlFor="state">State</label>
          <input type="text" name="state" value={state} onChange={onChange} />
        </div>
        <div className="form-group">
          <label htmlFor="gender">Gender</label>
          <select name="gender" value={gender} onChange={onChange}>
            <option value="">Select Gender</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
            <option value="Other">Other</option>
          </select>
        </div>
        <button type="submit" className="profile-button" disabled={loading}>
          {loading ? 'Updating...' : 'Update Profile'}
        </button>
      </form>
    </div>
  );
};

export default Profile;
